HJaB5bIIACyRdXVV7gO.jpg',4,NULL),(6,'Angel Has Fallen',0,'2019-06-25','After the events in the previous film, Secret Service agent Mike Banning finds himself framed for an assassination attempt on the President. Pursued by his own agency and the FBI, Banning races to clear his name and uncover the real terrorist threat which has set its sights on Air Force One.',5.8,'unknow',169.408,'','/fapXd3v9qTcNBTm39ZC4KUVQDNf.jpg','/k2WyDw2NTUIWnuEs5gT7wgrCQg6.jpg',10,NULL),(7,'One Piece: Stampede',0,'2019-09-24','One Piece: Stampede is a stand-alone film that celebrates the anime\'s 20th Anniversary and takes place outside the canon of the \"One Piece\" TV series. Monkey D. Luffy and his Straw Hat pirate crew are invited to a massive Pirate Festival that brings many of the most iconic characters from throughout the franchise to participate in competition with the Straw Hats to find Roger\'s treasure. It also pits the Straw Hats against a new enemy named Bullet, a former member of Roger\'s crew.',7.3,'unknow',136.105,'','/4E2lyUGLEr3yH4q6kJxPkQUhX7n.jpg','/iGnCzXEx0cFlUbpyAMeHwHWhPhx.jpg',52,NULL),(8,'Maleficent: Mistress of Evil',0,'1900-01-20','Maleficent and her goddaughter Aurora begin to question the complex family ties that bind them as they are pulled in different directions by impending nuptials, unexpected allies, and dark new forces at play.',7.2,'unknow',84.61,'','/tBuabjEqxzoUBHfbyNbd8ulgy5j.jpg','/skvI4rYFrKXS73BJxWGH54Omlvv.jpg',1,NULL),(9,'Ip Man 4: The Finale',0,'1900-01-20','Ip Man 4 is an upcoming Hong Kong biographical martial arts film directed by Wilson Yip and produced by Raymond Wong. It is the fourth in the Ip Man film series based on the life of the Wing Chun grandmaster of the same name and features Donnie Yen reprising the role. The film began production in April 2018 and ended in July the same year.',0,'unknow',109.701,'','/vn94LlNrbUWIZZyAdmvUepFBeaY.jpg','/ekP6EVxL81lZ4ivcqPsoZ72rY0h.jpg',121,NULL),(10,'Gemini Man',0,'1900-01-20','Henry Brogen, an aging assassin tries to get out of the business but finds himself in the ultimate battle: fighting his own clone who is 25 years younger than him and at the peak of his abilities.',5.6,'unknow',155.556,'','/uTALxjQU8e1lhmNjP9nnJ3t2pRU.jpg','/c3F4P2oauA7IQmy4hM0OmRt2W7d.jpg',121,NULL),(11,'Fast & Furious Presents: Hobbs & Shaw',0,'1900-01-20','Ever since US Diplomatic Security Service Agent Hobbs and lawless outcast Shaw first faced off, they just have swapped smacks and bad words. But when cyber-genetically enhanced anarchist Brixton\'s ruthless actions threaten the future of humanity, both join forces to defeat him. (A spin-off of “The Fate of the Furious,” focusing on Johnson\'s Luke Hobbs and Statham\'s Deckard Shaw.)',6.6,'unknow',110.374,'','/kvpNZAQow5es1tSY6XW2jAZuPPG.jpg','/qAhedRxRYWZAgZ8O8pHIl6QHdD7.jpg',0,NULL),(12,'The Lion King',0,'1900-01-20','Simba idolises his father, King Mufasa, and takes to heart his own royal destiny. But not everyone in the kingdom celebrates the new cub\'s arrival. Scar, Mufasa\'s brother—and former heir to the throne—has plans of his own. The battle for Pride Rock is ravaged with betrayal, tragedy and drama, ultimately resulting in Simba\'s exile. With help from a curious pair of newfound friends, Simba will have to figure out how to grow up and take back what is rightfully his.',7.1,'unknow',194.319,'','/2bXbqYdUdNVa8VIWXVfclP2ICtT.jpg','/nRXO2SnOA75OsWhNhXstHB8ZmI3.jpg',14,NULL),(13,'Ford v Ferrari',0,'1900-01-20','American car designer Carroll Shelby and the British-born driver Ken Miles work together to battle corporate interference, the laws of physics, and their own personal demons to build a revolutionary race car for Ford Motor Company and take on the dominating race cars of Enzo Ferrari at the 24 Hours of Le Mans in France in 1966.',8,'unknow',110.183,'','/6ApDtO7xaWAfPqfi2IARXIzj8QS.jpg','/n3UanIvmnBlH531pykuzNs4LbH6.jpg',545,NULL),(14,'Cars',0,'1900-06-20','Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town\'s offbeat characters.',6.7,'unknow',80.039,'','/jpfkzbIXgKZqCZAkEkFH2VYF63s.jpg','/a1MlbLBk5Sy6YvMbSuKfwGlDVlb.jpg',132,NULL),(15,'Aladdin',0,'1900-01-20','A kindhearted street urchin named Aladdin embarks on a magical adventure after finding a lamp that releases a wisecracking genie while a power-hungry Grand Vizier vies for the same lamp that has the power to make their deepest wishes come true.',7.1,'unknow',92.356,'','/3iYQTLGoy7QnjcUYRJy4YrAgGvp.jpg','/rVqY0Bo4Npf6EIONUROxjYAJfmD.jpg',158,NULL),(16,'23-F: la película',0,'1900-11-20','The failed coup d\'état of February 23, 1981, which began with the capture of the Congress of Deputies and ended with the release of parliamentarians, put at serious risk the Spanish democracy.',5.6,'unknow',48.004,'','/fgw1XkdmSaD226KtIKcdNmysb3X.jpg','/53mOHTuLtzlzGX7vw6ryQCU0gUC.jpg',798,NULL),(17,'Spider-Man: Far from Home',0,'1900-01-20','Peter Parker and his friends go on a summer trip to Europe. However, they will hardly be able to rest - Peter will have to agree to help Nick Fury uncover the mystery of creatures that cause natural disasters and destruction throughout the continent.',7.6,'unknow',207.098,'','/lcq8dVxeeOqHvvgcte707K0KVx5.jpg','/5myQbDzw3l8K9yofUXRJ4UTVgam.jpg',1234,NULL),(18,'El Camino: A Breaking Bad Movie',0,'1900-01-20','In the wake of his dramatic escape from captivity, Jesse Pinkman must come to terms with his past in order to forge some kind of future.',7,'unknow',71.492,'','/ePXuKdXZuJx8hHMNr2yM4jY2L7Z.jpg','/ijiE9WoGSwSzM16zTxvUneJ8RXc.jpg',1654,NULL),(19,'Doctor Sleep',0,'1900-01-20','A traumatized, alcoholic Dan Torrance meets Abra, a kid who also has the ability to \"shine.\" He tries to protect her from the True Knot, a cult whose goal is to feed off of people like them in order to remain immortal.',7.1,'unknow',71.968,'','/p69QzIBbN06aTYqRRiCOY1emNBh.jpg','/1nm0sk8UUx9jHCTHuMKe2jkt4Pn.jpg',1778,NULL),(20,'Kiểm thử',150,'2010-05-17','Tuy nói Hắc Uyên thực lực so với bọn hắn mấy cái xác thực mạnh hơn một chút, nhưng cái này cùng thương thế khôi phục không quan hệ, chủ yếu nơi đây Mặc Sào là Hắc Uyên Mặc Sào, tại hắn hữu tâm khống chế phía dưới, Mặc Sào lực lượng đại bộ phận đều tại trợ hắn chữa thương, chỉ có một bộ phận rất nhỏ tại bị mặt khác mấy cái vực chủ chia sẻ.',7,'Phú Quốc',70,'Tiếng Việt','/xvYCZ740XvngXK0FNeSNVTJJJ5v.jpg','/61sbyO47yIpsMFyLhY1MWcqjg1Q.jpg',313,NULL),(21,'Avengers: Infinity War',0,'1900-01-20','As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.',8.3,'unknow',84.267,'','/7WsyChQLEftFiDOVTGkv3hFpyyt.jpg','/bOGkgRGdhrBYJSLpXaxhXVstddV.jpg',12348,NULL),(22,'Anna',0,'1900-01-20','Beneath Anna Poliatova\'s striking beauty lies a secret that will unleash her indelible strength and skill to become one of the world\'s most feared government assassins.',6.4,'unknow',58.093,'','/d8u4jpkDKgEPDJUl4g3vOOP3mDe.jpg','/pIL9e5cN6RNugDCCLwn3stfb9HE.jpg',13247,NULL),(23,'Ellipse',0,'1900-01-20','A man and his dog are stranded on a volatile, oval-shaped planet and are forced to adapt and escape before time destroys them both.',4,'unknow',118.121,'','/4I0CQfnMy6sRR7QhgqsXR16TmIs.jpg','/sxPycUAaLJJGq2lhhgzR96ePaO0.jpg',2387,NULL),(24,'John Wick: Chapter 3 - Parabellum',0,'1900-01-20','Super-assassin John Wick returns with a $14 million price tag on his head and an army of bounty-hunting killers on his trail. After killing a member of the shadowy international assassin’s guild, the High Table, John Wick is excommunicado, but the world’s most ruthless hit men and women await his every turn.',7.1,'unknow',65.512,'','/ziEuG1essDuWuC5lpWUaw1uXY2O.jpg','/stemLQMLDrlpfIlZ5OjllOPT8QX.jpg',12332,NULL),(25,'Ralph Breaks the Internet',0,'1900-01-20','Video game bad guy Ralph and fellow misfit Vanellope von Schweetz must risk it all by traveling to the World Wide Web in search of a replacement part to save Vanellope\'s video game, \"Sugar Rush.\" In way over their heads, Ralph and Vanellope rely on the citizens of the internet -- the netizens -- to help navigate their way, including an entrepreneur named Yesss, who is the head algorithm and the heart and soul of trend-making site BuzzzTube.',7.2,'unknow',47.173,'','/qEnH5meR381iMpmCumAIMswcQw2.jpg','/88poTBTafMXaz73vYi3c74g0y2k.jpg',121,NULL),(26,'47 Meters Down: Uncaged',0,'1900-01-20','A group of backpackers diving in a ruined underwater city discover that they have stumbled into the territory of the ocean\'s deadliest shark species.',4.9,'unknow',57.517,'','/g4z7mDmJmx23vsVg6XNWcnXb6gc.jpg','/3uG3aOhEzFCjcQulsJQiAzLSrw8.jpg',803,NULL),(27,'Klaus',0,'1900-01-20','When Jesper distinguishes himself as the Postal Academy\'s worst student, he is sent to Smeerensburg, a small village located on a icy island above the Arctic Circle, where grumpy inhabitants barely exchange words, let alone letters. Jesper is about to give up and abandon his duty as a postman when he meets local teacher Alva and Klaus, a mysterious carpenter who lives alone in a cabin full of handmade toys.',8.7,'unknow',85.749,'','/q125RHUDgR4gjwh1QkfYuJLYkL.jpg','/mlxKite1x1PgmIhJgAxNS9eHmH8.jpg',722,NULL),(28,'Shipwrecked',0,'1900-01-19','A young Norwegian boy in 1850s England goes to work as a cabin boy and discovers some of his shipmates are actually pirates.',6.5,'unknow',29.417,'','/jf2PkR0Yt0ZRMKqtJzwja7JV2Hk.jpg','/rp5dh6D0MLOIIVHkugv6Z8gBLwg.jpg',813,NULL),(29,'Good Boys',0,'1900-01-20','A group of young boys on the cusp of becoming teenagers embark on an epic quest to fix their broken drone before their parents get home.',6.5,'unknow',45.114,'','/tximyCXMEnWIIyOy9STkOduUprG.jpg','/6Xsz9KHQmCcIcj3CoWQq5eLtVoT.jpg',3137,NULL),(30,'Dark Phoenix',0,'1900-01-20','The X-Men face their most formidable and powerful foe when one of their own, Jean Grey, starts to spiral out of control. During a rescue mission in outer space, Jean is nearly killed when she\'s hit by a mysterious cosmic force. Once she returns home, this force not only makes her infinitely more powerful, but far more unstable. The X-Men must now band together to save her soul and battle aliens that want to use Grey\'s new abilities to rule the galaxy.',6.1,'unknow',50.49,'','/cCTJPelKGLhALq3r51A9uMonxKj.jpg','/cjRUhKyt2Jo3V1KNzc5tpPNfccG.jpg',3221,NULL),(31,'Lady and the Tramp',0,'1900-01-20','The love story between a pampered Cocker Spaniel named Lady and a streetwise mongrel named Tramp. Lady finds herself out on the street after her owners have a baby and is saved from a pack by Tramp, who tries to show her to live her life footloose and collar-free.',7.2,'unknow',64.145,'','/kzJ4a0ITuMJDuX2IjFKYG6QIipW.jpg','/73curw674iTzTX81AGaj5dyZUX5.jpg',1321,NULL),(32,'Dolemite Is My Name',0,'1900-01-20','The story of Rudy Ray Moore, who created the iconic big screen pimp character Dolemite in the 1970s.',7.2,'unknow',38.374,'','/kURLLZ10A0ZhI5bVIyOuPBzbtSB.jpg','/8FuiFasbeFQj24Vqx6JqSCqj5lO.jpg',2337,NULL),(33,'Toy Story 4',0,'1900-01-20','Woody has always been confident about his place in the world and that his priority is taking care of his kid, whether that\'s Andy or Bonnie. But when Bonnie adds a reluctant new toy called \"Forky\" to her room, a road trip adventure alongside old and new friends will show Woody how big the world can be for a toy.',7.6,'unknow',53.819,'','/w9kR8qbmQ01HwnvK4alvnQ2ca0L.jpg','/m67smI1IIMmYzCl9axvKNULVKLr.jpg',1231,NULL),(34,'Parasite',0,'1900-01-20','All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.',8.5,'unknow',61.276,'','/7IiTTgloJzvGI1TAYymCfbfl3vT.jpg','/TU9NIjwzjoKPwQHoHshkFcQUCG.jpg',12237,NULL),(35,'The King',0,'1900-01-20','England, 15th century. Hal, a capricious prince who lives among the populace far from court, is forced by circumstances to reluctantly accept the throne and become Henry V.',7.2,'unknow',52.01,'','/8u0QBGUbZcBW59VEAdmeFl9g98N.jpg','/r0AWsZ9dBvC2No3kND9nxv3iRbb.jpg',23212,NULL),(36,'Terminator Genisys',0,'1900-01-20','The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John\'s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.',5.9,'unknow',59.255,'','/5JU9ytZJyR3zmClGmVm9q4Geqbd.jpg','/3DmxSJ08m9wwbxwbwHzA4dunGNO.jpg',788,NULL),(37,'It Chapter Two',0,'1900-01-20','27 years after overcoming the malevolent supernatural entity Pennywise, the former members of the Losers\' Club, who have grown up and moved away from Derry, are brought back together by a devastating phone call.',6.9,'unknow',82.837,'','/zfE0R94v1E8cuKAerbskfD3VfUt.jpg','/8moTOzunF7p40oR5XhlDvJckOSW.jpg',3247,NULL),(38,'John Wick',0,'1900-01-20','Ex-hitman John Wick comes out of retirement to track down the gangsters that took everything from him.',7.2,'unknow',56.231,'','/5vHssUeVe25bMrof1HyaPyWgaP.jpg','/iJlGxN0p1suzloBGvvBu3QSSlhT.jpg',7894,NULL),(39,'The Angry Birds Movie 2',0,'1900-01-20','Red, Chuck, Bomb and the rest of their feathered friends are surprised when a green pig suggests that they put aside their differences and unite to fight a common threat. Aggressive birds from an island covered in ice are planning to use an elaborate weapon to destroy the fowl and swine.',6.4,'unknow',50.002,'','/ebe8hJRCwdflNQbUjRrfmqtUiNi.jpg','/k7sE3loFwuU2mqf7FbZBeE3rjBa.jpg',7941,NULL),(40,'Once Upon a Time... in Hollywood',0,'1900-01-20','A faded television actor and his stunt double strive to achieve fame and success in the film industry during the final years of Hollywood\'s Golden Age in 1969 Los Angeles.',7.6,'unknow',48.573,'','/8j58iEBw9pOXFD2L0nt0ZXeHviB.jpg','/nGJpQCAn2NKeDoEflLI5DIvsqoQ.jpg',1234,NULL);
